    return (
      <section className="main-video">
        <div className="main-video-container">
          <span className="main-video-container__title">
            BMX Rampage: 2018 Highlights
          </span>
          <span className="main-video-container__author">By Red Cow</span>
          <span className="main-video-container__date">12/18/2018</span>
          <span className="main-video-container__views">
            <img src={Views} alt="views" />
            1,001,23
          </span>
        </div>
      </section>
    );
  }
}
